Sure, I'd be happy to help! Here are a few popular compiler optimization techniques with example codes:

1. Constant Folding: Constant folding is the process of evaluating constant expressions at compile time instead of runtime. This can result in faster code execution and reduced memory usage.

Example:

Before optimization:
```c
int x = 2 + 3;
```
After optimization:
```c
int x = 5;
```
2. Dead Code Elimination: Dead code elimination is the process of removing code that does not affect the program's output. This can result in faster code execution and reduced memory usage.

Example:

Before optimization:
```c
int x = 5;
if (false) {
  x = x + 1;
}
```
After optimization:
```c
int x = 5;
```
3. Loop Unrolling: Loop unrolling is the process of replicating the body of a loop several times to reduce the number of loop iterations. This can result in faster code execution.

Example:

Before optimization:
```c
for (int i = 0; i < 4; i++) {
  a[i] = b[i] + c[i];
}
```
After optimization:
```c
for (int i = 0; i < 4; i += 4) {
  a[i] = b[i] + c[i];
  a[i+1] = b[i+1] + c[i+1];
  a[i+2] = b[i+2] + c[i+2];
  a[i+3] = b[i+3] + c[i+3];
}
```
4. Common Subexpression Elimination: Common subexpression elimination is the process of detecting and eliminating common subexpressions in a program. This can result in faster code execution and reduced memory usage.

Example:

Before optimization:
```c
int x = y + z;
int y = x + z;
```
After optimization:
```c
int x = y + z;
int y = x;
```
5. Function Inlining: Function inlining is the process of replacing a function call with the actual code of the function. This can result in faster code execution and reduced memory usage.

Example:

Before optimization:
```c
int add(int a, int b) {
  return a + b;
}

int x = add(y, z);
```
After optimization:
```c
int x = y + z;
